import React from 'react'

const TotalCost = ({ products }) => {
    return (
        <div className="totalCost-elements">
            <img style={{ paddingTop: "40px" }} src={require('./images/shop.png')} alt="shopping cart" width="120" height="100" ></img>
            <p style={{ margin: "0", paddingTop: "80px", paddingRight: "200px" }}>
                {products[0].price * products[0].amount + products[1].price * products[1].amount + products[2].price * products[2].amount}
                $
            </p>
        </div>
    )
}

export default TotalCost;
